const url = process.env.REACT_APP_YT_API_URL;


export async function search(query = ""){
    //console.log(url);
    const comand =  "/search?q=";
    const options = ['?=maxResults=10'].join('')
    let response = await fetch(url + comand + encodeURI(query) + options);
    let json = await response.json();
    return json;

}
